INSERT INTO `ptype` (`id`, `parent_id`, `rel_table`, `type`, `name`, `alias`, `title`, `meta_description`, `meta_keywords`, `header`, `text`, `pic`) VALUES
(1, 0, 'performance_accessories', 'product', 'performance accessories', 'performance-accessories', 'performance accessories', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'performance accessories', 'jhkjhk222', ''),
(2, 0, 'performance_accessories', 'product', 'body kits', 'body-kits', 'Body Kits', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'body kits', '<p>There are two main functions served by auto body kits: for function and aesthetic enhancements. Thus, it is one of the most basic tools needed by every car owner to ensure that their vehicle delivers optimum performance. You can find these kits in automotive shops and is essential for the maintenance of your vehicle. For any car enthusiast, it is therefore important that you know about basic components included in the kit so you can utilize them to the fullest. Your ability to utilize fully the kit components is also vital in ensuring that you can provide maximum performance and function.</p>\r\n\r\n<p>The most basic component involves maintaining the exterior parts of the vehicle. You can get separate parts or get the complete bundle so you can produce an entirely new look for your vehicle. This is very true with racers because the exterior parts of the body will also enhance the car&#39;s performance.</p>\r\n\r\n<a rel="example_group" class="img-r" style="margin-right:12px" href="http://www.scienceg8.com/templates/images/body_kits.jpg" title=" Body Kits"><img alt=" Body Kits" src="http://www.scienceg8.com/templates/images/body_kits_prev.jpg"></a>\r\n\r\n<p>Slight enhancements to the exterior and interior components of your vehicle will incrementally boost the performance of the vehicle. You can use the kit to modify various parts of the vehicle, such as the bumpers, grills, roofs, headlights, and spoilers, to name a few. Hence, you can utilize it to achieve optimum automobile performance that will increase the value of your vehicle.  Your ability to invest in a good quality auto body kits will therefore make a difference in the kind of enhancement you can enjoy.</p>\r\n\r\n<p>It is important to note that there is specialized auto body kits sold in the market whether online or offline that are designed for specific car models. Hence, it is best to go for shops that have a wide selection of kits to choose from, regardless of the type of vehicle you are driving. If possible, take the time to look into the basic car components included in the kit so you can assess the quality of the materials. In an online automotive shop, you can determine the quality of the kit by looking at the reputation of the shop itself and the manufacturer.</p>\r\n\r\n<p>It is also important to do a bit of research on car body kits - what are the various components and how to utilize it to the fullest. Thus, you will know how to take advantage of these tools for your own benefit, regardless of what aspect of your vehicle you need improvement on. You may also consult various experts at the shop to get more insight into how to make the most of the body kits for your own benefit. In the end, it will be worth the investment you make. </p>', ''),
(3, 0, 'performance_accessories', 'product', 'air intakes', 'air-intakes', 'Air Intakes', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'Air Intakes', '<p>Did you think that you are the only one who needs oxygen and is that just because you are a living being? You’ve been dead wrong. Your car is breathing too, at least its engine does. Combustion needs oxygen and your car is certainly burning a lot of gas. But how it gets the right amount of oxygen, you might ask yourself. Well, there is a special part called “air intake system” that filters the air and brings it to your engine so it can burn the fuel. These air intakes are very important, like your nose and lungs are for your body. You nose is cleaning the air and your lungs are transferring it to your blood. If there would be anything wrong with your respiratory system you’d choke and die. The same is true with your car, so it is very important that you keep the air intake clean and whole. Another important thing to remember is that the engine might overheat itself, so you need to feed it cold air to reduce the temperature.</p>\r\n<img alt=" Air Intakes" src="http://www.scienceg8.com/templates/images/air_intakes_prev.jpg"  class="img-r">\r\n<p>You may find a lot of offers on the market that will promise you a great improvement of your engine’s performance and level of maintenance. The information is true if is backed up with good reviews and quality products. Expect an improvement of up to 30-50 horsepower and a cleaner, lower maintenance air intake if the product is of good quality. You might also want to be sure the product you buy can be easily installed in its place and that it fits your car model. Depending on your ride and your usual trips, you need to decide if you’ll be satisfied with a regular air intake or if you need some modifications in order to get the best performance out of it. For example, if you are a safari guy and cross lots of streams or deserted, sandy areas, then you need some snorkels to save it from drowning/choking.</p>\r\n\r\n<p>Especially if your ride is a sporty one and you’ve installed a supercharger on it, for example, the air intake will help it breath and work at its full potential. Nothing is worse than having your car all prepared to make a stand and then see it choke because of a lack of oxygen. Air intakes will make your engine purr like a kitten in cruise mode and roar like a lion when you mean business. </p>', ''),
(4, 0, 'car_spoilers', 'product', 'car spoilers', 'car-spoilers', 'Car Spoilers', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'Car Spoilers', '<p>If you&#39;re looking for a way to enhance your car&#39;s appearance and boost its performance, you will find that attaching a spoiler in its rear or at the front very useful and charming. Spoilers are great addition and help you create a unique impression for your car. They improve the overall appearance of your vehicle and somehow make them sleeker and unique. Of course, attaching spoiler does not only satisfy people&#39;s need for beautiful upgrades. In fact, the main reason that a car owner attaches spoilers to their auto is to boost their car’s performance since spoilers actually “spoil” the wind movement that has no help in keeping the car in steady motion. They also produce down force by reducing the resistance of the wind during high speed or highway driving.</p>\r\n<img alt=" Car Spoilers" src="http://www.scienceg8.com/templates/images/car_spoilers_prev.jpg" class="img-r">\r\n<p>Car spoilers can be found at the rear and sometimes at the front of the car. The front spoiler is often called the air dam while the rear is usually called the wing spoiler. In the case of sports car a wing spoiler acts as a force that push the tires steady on the road thus reducing the instability and drags of the car. This also ensures a more forceful and easy turning, using of brakes and maneuvering.</p>\r\n\r\n<p>Car spoilers come in several shapes, styles and weight and can be custom built in order to fit perfectly in any car models, make, and year. They are actually not difficult to install because they are often packed with mounting bolts and necessary gaskets for sealing. They are usually made from lightweight materials like polyutherane, fiberglass or light steel, which are durable and high resistant against bumps, sags and cracks. In addition, since they are of varying styles and makes attaching a spoiler could give your car an overall change in its external appearance.</p>\r\n\r\n<p>There are people that use spoilers for appearance and decorative purposes only, while spoilers actually enhance the aerodynamics of the vehicles some install them for the sole purpose of enhancement and aesthetics with little consideration for its function. Some even create their own modification based on their preferences and style that they want to achieve regardless whether the spoiler helps them on the road or not.</p>\r\n\r\n<p>If your car has no factory-built spoiler and you want to put one you will realize that finding a preferable spoiler to custom-fit your car is not difficult, nowadays there are many aftermarket manufacturers and sellers and they are actually willing to give you the best price options. For one, there are OEM Spoilers, these are the imitation of the original factory built ones and are tested to fit perfectly in your car. You can also opt for custom-made spoilers; these are built according to the model and make of your car but are not replica versions. There are also sellers that offer universally made spoilers and high-rise or specialty spoilers for your vehicle but you need to be careful with your vehicle measurement to be able to obtain the perfect fit</p>', ''),
(5, 0, 'exhaust_systems', 'product', 'exhaust systems', 'exhaust-systems', 'Exhaust Systems', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'Exhaust Systems', '<p>Maintaining a healthy car exhaust system is the duty of every responsible car owners. The impact of a faulty exhaust system on the environment cannot be moderated unless collective actions will be undertaken not only by the car owners but as well as car manufacturers.</p>\r\n\r\n<p>Your car exhaust produces a total of six gases as emissions. Out of these 6 gases, only 3 are considered less harmful. They are nitrogen, carbon dioxide and water vapor while the remaining 3 that pose great hazards to humans and environment are carbon monoxide, nitrogen oxide and nitrogen monoxide. Your exhaust system make sure that these deadly emissions are blown away from your front car and therefore protect you from inhaling these noxious fumes and safeguard you and other car&#39;s passengers. However, if your exhaust fails, then it poses great dangers not only to car passengers but also to innocent bystanders. The prolonged exposure to these dangers has adverse effects on the health of human and the environment.</p>\r\n\r\n<img alt=" Exhaust Systems" src="http://www.scienceg8.com/templates/images/exhaust_systems_prev.jpg"  class="img-r">\r\n\r\n<p>Maintaining a healthy exhaust system is a contributing factor in maintaining your car&#39;s smooth running engine and its fuel&#39;s efficiency. The pressures in engine combustion caused noise and a well-maintained exhaust system is free from this irritating noise. If your exhaust system is broken, you can be under fire as there are existing regulations on maintaining emissions levels. If your vehicle failed its MoT test, chances are your exhaust system is broken and need repairing.  When this happens, you are willing contributor of high levels of air pollutants. You are endangering humans’ life as well as the environment. Early detection would save your car from further damages and money from penalties.</p>\r\n\r\n<p>In some countries especially those with high level of air pollutions, it is mandatory for all motorist to keep their vehicles emissions within a specified tolerance level. This is a collective action from their government and from groups with anti-pollution advocacy. It is also mandatory to have it check at least twice a year. Detections of cracks, broken hangers, leaking joints, failed gaskets and presence of high levels of pollutants will saved you car from untoward incidents and make it more environment-friendly.</p>\r\n\r\n<p>It is true that increased in car usage cannot be controlled as people have the rights to enjoy the benefits of having and driving their own vehicles. But, in some ways, we can control air pollutions caused by these motorized handsome cubicles if only people are considerate and responsible. Your well- maintained exhaust system can be your simple gesture of advocating environment-saving causes.  Fewer emissions would certainly mean reduced air pollutants. Carmakers on the other can give their share by producing more-eco-friendly exhaust system for their car models.</p>\r\n\r\n<p>Cars, trucks and other motor vehicles are sources of noise and air pollution. However, they have been part of our modern existence that we cannot totally ignore. It is your duty as a responsible car owner to maintain a healthy exhaust as it is also your duty to help reduced noise and air pollutions.</p>', ''),
(6, 0, 'performance_chips', 'product', 'performance chips', 'performance-chips', 'Performance Chips', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'Performance Chips', '<p>There comes a time when every car owner, passionate about his drive, would want to upgrade his ride a little. Maybe it will be a way of escaping the same routine or just the need for something new and challenging, but the perfect solution can only be a performance chip. Whether you already have one and want to change it or it’s your first time with something like this, a thorough informative study is a good option.\r\n\r\n</p><p><img class="img-r" alt=" Performance Chips" src="http://www.scienceg8.com/templates/images/performance_chips_prev.jpg">\r\n\r\nWhat exactly is a performance chip and how can it help you improve your ride? This accessory will help you improve your horsepower, but will also help with the optimization of fuel consumption. Don’t worry about the best fuel mixture or torque output anymore; your performance chip will take care of that. In addition, the best thing about it is that you can install them on your own, without any special tools or complicated instructions, in less than thirty minutes. Once installed, the performance chip will be taking charge of all the modifications that will make the inside tuning complete and ready to go. If, somewhere in the future, you’ll want to change the performance chip into a newer and complete version, there a two distinct possibilities: change the whole system or just reprogram the already existing one and upgrade its performances. This is a very easy way have the best performances without changing anything.</p>\r\n\r\n<p>Even if you don’t want to make a whole makeover to your car, the benefits you can receive from your performance chip will just help you control your vehicle better. Just think of those very busy days when you get to cross the entire town and all the cars in the city seem to be on the road at the same time. Doesn’t your leg hurt from starting and stopping the car so many times, don’t you feel the strain in your knees from so many breaks and accelerations? And not to mention what it does to your fuel consumption. Well, having a performance chip won’t help you take of over all the other cars, but it will make your engine more responsive to your maneuvers and your fuel consumption optimal. Also, if you’ll need to accelerate in order to catch the next green light in time, the performance chip will help you do that, too. Either you have a powerful car that needs to get even more powerful, or you need to tame your car, count on this accessory to get you there.</p>', ''),
(7, 0, 'wheels', 'product', 'wheels & rims', 'wheels-rims', 'Wheels and Rims', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'Wheels and Rims', '<p>Often considered the same, the wheels and rims are a very important esthetic and functional part of your car. In the more strict lexical meaning, the rim is the central part of the wheel that sustains the tire, while the wheel is the entire complex. Most online and offline car parts shops offer a large variety of rims, usually blending the two notions together as wheels and rims. There are two different types of rims out there: the cheap, ordinary ones, which need a wheel cover to improve their aspect and the more expensive, esthetic ones that go by themselves.</p>\r\n\r\n<img alt=" Wheels ↦ Rims" src="http://www.scienceg8.com/templates/images/wheels_rims_prev.jpg" class="img-r">\r\n\r\n<p>The trick about a good rim and a balanced wheel is to match the rim with the tire. If you use a too wide or too narrow rim, the tire will wear out quicker and could even get you in trouble on the road. The most dangerous moments with an unfit rim is when taking a turn, as the car can lose its balance if the wheels are not as steady as they should.</p>\r\n\r\n<p>Therefore, the most important thing, when choosing a rim, is to match it with your car model. The online shops that offer you car parts and accessories usually provide with a sorting service so that you can pick the exact rim and wheel for your cars’ model and year of manufacturing. However, if you want to explore by yourself, you’re welcomed to do so, just try to stay in the limits of your car’s original wheel proportions.</p>\r\n\r\n<p>With respect to the esthetics of your car, the manufacturers have thought of just about everything. The only things you need to do is decide upon the alloy you’re interested in (whether is chrome, steel or something else), the color you’d like for your ride and the model. There are hundreds and hundreds of different models, from the ordinary looking ones to the most exotic you could think of. You can also choose, depending on your budget, if you want to buy used wheels and rims, new, already made ones or maybe you’d fancy some custom made rims with something personal on them.</p>\r\n\r\n<p>Any car owner that would like to upgrade the looks of his car is bound to start with the koko kuture custom wheels and rims, since they are the easiest to change and offer a great improvement to the way your car will look in your friends eyes. Give it a polish and some new wheels and you have a brand new ride.</p>', ''),
(8, 2, '', 'product', 'fiberglass kits', 'fiberglass-kits', 'Fiberglass Body Kits', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'Fiberglass Body Kits', '			<img src="http://www.scienceg8.com/templates/images/fiberglass_img.jpg" alt="Fiberglass Body Kits" class="img-r">\r\n			<p>Body kits for VAZ are car parts that may be replaced in order to make a car lighter, its aerodinamics and exterior better. It&#39;s a customization/personalization of a car. The most popular car kits are front and rear bumpers, side skirts and spoiler. Sometimes they want to replace a hood, side mirrors or wheel archs. Everything is possible with fiberglass.</p>\r\n			<p>Fiberglass -  is a composite material made from synthetic fiber and plastic resin. It&#39;s quite strong, very light and relatively cheep, but in time it fatigues and cracks may appear. Also it is volnurable to damages. They say it is easily repairable but be careful if you want to do it yourself! This material can particulate and become out of control, what may lead to skin or eye injuries. Not really a good perspective. So professionals are welcome.</p>\r\n			<p>The strength of a fiberglass body kit depends on the way they mold it, so the cheeper the part is, the less strong it is, for sure. The other "stronger" composite materials are Poly-Urethane, Duraflex, ABS Plastic and Carbon Fiber. But they are also much more expensive.</p>', ''),
(9, 2, '', 'product', 'abs plastic body kits', 'abs-plastic-body-kits', 'ABS Plastic Body Kits', 'Choosing the right Performance Accessories for your car is best thing that you will have to do for yourself as it greatly depends on what you decide to use in your car and it also depends how good your car is going to act with these custom Performance Accessories', 'racing accessories, aftermarket body kits, air intakes, custom spoilers, aftermarket exhaust systems, performance chips, custom wheels, car rims', 'ABS Plastic Body Kits', '<img src="http://www.scienceg8.com/templates/images/abs-plastic.jpg" alt="ABS Plastic Body Kits" class="img-r">\r\n			<p>Replacing some parts of your car in order to make it look or perform better is always about picking the right composite material to match your expectations, either financial or of durability and weight. It&#39;s well known that there are lots of materials to pick from: Fiberglass, Poly-Urethane, Duraflex, ABS Plastic and Carbon Fiber. Fiberglass is very cheep, light but not strong enough.  Poly-Urethane is very durable, expensive but quite heavy. Carbon Fiber is the lightest, the strongest and the most expensive. The most popular and widely used composite material is  ABS Plastic.</p>\r\n			<p>Acrylonitrile butadiene styrene (ABS) is derived from acrylonitrile, butadiene, and styrene. Those smart elements make an ultimate mixture for a strong and tough material. And what&#39;s the most important - very durable! ABS Plastic is resistable to different chemical elements, temperature and humidity. Though it is flammable when it is over 221 °F</p>\r\n			<p>This material is widely used because of its light weight, great durability and fitment. The problem is that it&#39;s hard to repaire it, but to damage it is even harder. It costs 3-4 times more than common  Fiberglass and a bit less than Carbon Fiber. To make a right choice while customizing your car is to pick ABS Plastic Body Kits for VAZ - light, durable and flexible enough.</p>', ''),
